import React, { useState } from 'react';
import { database } from './database'; // Import your database module

const PrimeComponent = () => {
  const [primeRecords, setPrimeRecords] = useState([]);

  const handleGetPrimeRecords = async () => {
    // Call your database function to fetch prime records
    const records = await database.getPrimeRecords();
    setPrimeRecords(records);
  };

  return (
    <div>
      <button type="button" onClick={handleGetPrimeRecords}>
        Get Prime Records
      </button>
      <ul>
        {primeRecords.map((record, index) => (
          <li key={index}>
            <p>Date: {record.date}</p>
            <p>Start: {record.start}</p>
            <p>End: {record.end}</p>
            <p>Algorithm: {record.algorithm}</p>
            <p>Elapsed time:</p> {/* Move TimeElapsed outside of p */}
            {/* Assuming TimeElapsed is a component you have */}
            <TimeElapsed />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PrimeComponent;
